        uint256 amount;
        uint256 price;
        uint256 royalty;
        address payable creator;
        address payable seller;
        address payable owner;
        address nftContract;
        IERC20 token;
    }

    //a mapping to point to our structure marketItem. It will take marketItemId as an input.
    // mapping(uint256 => MarketItem) private allMarketItems;
